(function () {
	var input={'jsonInput' : "{'method':'getQuickToolsRootContent','params':[],'id':'0'}", 'version' : 1};
	qtdojo.ready(function() {
	      qtdojo.io.script.get({
	    	  content:input,
	    	   url: "https://" + qt.quicktoolsHost + "/go/QTApiAction_input",
			   callbackParamName: "_qtCallback",
		       load: function(data) {
	    	  		qtdojo.create('script', {
		  	  			src : 'https://' + qt.quicktoolsHost + '/go/js/webtrends.js'
		  	  		}, qtdojo.byId(qt.quicktoolsRootElementId));		  	  		
	    	  	
	    	  		var openInit=(qtdojo.hasClass(qtdojo.byId(qt.quicktoolsRootElementId), 'open')) ? 'open' : '';
		  	  		qtdojo.empty(qtdojo.byId(qt.quicktoolsRootElementId));
		  	  		qtdojo.create('div', {
			  			innerHTML : data.result
			  		}, qtdojo.byId(qt.quicktoolsRootElementId));
			  		qtdojo.require("usps.quicktools.main.qt");
			  		
			  		qtdojo.addClass(qtdojo.byId(qt.quicktoolsRootElementId).children[0].children[0], openInit);
			  		
			  		qtdojo.ready(function() {
			  			USPS.QuickTools=new usps.quicktools.main.qt();
				  		USPS.QuickTools.load_css("https://" + qt.quicktoolsHost + "/go/styles/qt.css");
				  		USPS.QuickTools.initialize();
				  	});
			  	}, 
			  	
			  	error : function(error){
			  		console.warn("Error: " + error);
			  	}
	    });
	  });
}());
